import React from "react";
import "../style.css";
import logo from "./assets/logo.png"
import axios from "axios";
import {useHistory} from "react-router-dom";

function NavbarMember() {

  const history = useHistory();

  let userName = axios.get("/api/users/member").then((res)=>{
      console.log(res);
  })

  return (<nav className="nav">
        <img className="littleLogo" src={logo} alt="Nails on Time logo"></img>
        <nav className="icon" value={userName} onClick={history.push("/member")}><i className="fas fa-user-alt"/>
        </nav>
    </nav>)
};

export default NavbarMember;
